// src/pages/Home.jsx
import React from "react";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <div className="text-center py-5">
      <h1 className="text-primary">Welcome to the Healthcare System</h1>
      <p>Your trusted platform for healthcare management.</p>
      <Link to="/register" className="btn btn-primary">Get Started</Link>
    </div>
  );
};

export default Home;
